window.bookSummaryJSON = "<p>\"Traitor.\"</p> <p>That was my last thought before darkness took over.</p> <p>Now, I've just woken up in the hospital and realized that one of the men I love put me here. Rush is a member of the Trilogy, and there's nothing I can do to bring him back.</p> <p>Meanwhile, Dante has risen from the dead to take over the city and he has my father on his side.</p> <p>A new war is coming and Nico, Beck, Sophie, and I are ready to throw everything we have at defeating them before they destroy the city.</p> <p>It's the eleventh hour and we're losing, but I've never been one to go down without a fight.</p> <p>Contains mature themes.</p>"; 
